import styled, { css } from 'styled-components'
import { Link } from "react-router-dom";

export const Main = styled.main`
  width: 100%;
  height: 100%;
  background-color: #fff;
`

export const Header = styled.header`
  width: 100%;
  height: 80px;
  display: flex;
  align-items: center;
`
